    const catCardList = props.catBreeds.map((cat, index) => {
      if (cat.image !== undefined && cat.image.id !== undefined) {
        console.log(index);
        return <CatCard key={cat.image.id} cat={cat}></CatCard>;
      } else {
        return;
      }
    });
    console.log("", catCardList.length);
    return catCardList;
  }
  return <div className="cart-cards">{getCatCardList()}</div>;
};

